import LogedIn from "./LogedIn";
import { useState } from 'react';

export const Lists = () => {


    const ListContent = () => {
         const [setResults, results] = useState();     
        fetch(`https://not-pirate-bay.azurewebsites.net/user/register/${<LogedIn/>}`)
        .then((results) => result.json())
        .then(data => {
            if(!data.errors) { // checking for errors
                console.log("Error")
            } else {
              console.log(useState.results)
            }
        });
    };

    return (
        <div className="add-page">
            <div className="container">
                <div className="add-content">
                    <div className="input-wrapper">
                        
                    </div> 
                </div>
            </div>
        </div>
    );
}
export default Lists
